function setClassNotNull(idSymbol, idInput, classNameInput) {
  const symbol = document.getElementById(idSymbol);
  const input = document.getElementById(idInput);

  symbol.setAttribute('class', idSymbol);
  input.setAttribute('class', `${classNameInput} -notNull`);
}

export default setClassNotNull;
